import React from 'react';
import {
    View,
    Text,

    TouchableOpacity,

    TextInput,

    StyleSheet,
    ScrollView,
    StatusBar,
    ActivityIndicator

} from 'react-native';



const Home = ({ navigation }) => {
    return (
        <View style={{ flex: 1, color: '#4700b3' }}>
        <ScrollView contentContainerStyle={{ flexGrow: 1, justifyContent: 'center' }}>
        
           {/* <ActivityIndicator size="large" color="#6600ff" style={{justifyContent: "center"}} /> */}
           <Text>HOME</Text>
       
        </ScrollView>
         </View>
        )
}

export default Home
